import React from 'react';
import { Container } from 'react-bootstrap';

function ImgContainer({ usedIds, getSrc }) {
    return (
        <Container>
            <div className='d-flex flex-wrap justify-content-center box-container'>
                {usedIds.map(index => {
                    return (
                        <div className='box' key={index}>
                            <a href={getSrc(index, 'original')} target='_blank'>
                                <img className='img-fluid' alt='random image' src={getSrc(index, 'medium')} ></img>
                            </a>
                        </div>
                    )
                })}
            </div>
        </Container>
    );
};

export default ImgContainer;
